import React from "react";
import { useGallery } from "../../context/galleryContext";

const CartList = () => {
  const { cartItems } = useGallery();
  //   console.log("ðŸš€ ~ CartList ~ cartItems", cartItems);
  return (
    <div>
      <div className="">
        {cartItems.length > 0 &&
          cartItems.map((item) => (
            <div className="inline-flex gap-x-5 items-start" key={item.id}>
              <img
                src={item.url}
                alt=""
                className="w-10 h-10 object-cover rounded-full"
              />
              <button className="bg-red-500 text-sm text-white rounded-lg p-2">
                Delete
              </button>
            </div>
          ))}
      </div>
    </div>
  );
};

export default CartList;
